class Solution:
    def findSubstring(self, s: str, words: list) -> list:
        wordsMap = {}
        wordLen = 1000000
        result = []
        if len(words)>len(s):
            return result
        for word in words:
            if word not in wordsMap:
                wordsMap[word] = 1
                wordLen = len(word)
            else:
                wordsMap[word] = wordsMap[word]+1

        for i in range(len(s)-wordLen+1):
            tempWordMap = wordsMap.copy()
            flag = True
            for j in range(1,len(words)+1):
                word = s[i+wordLen*(j-1):i+wordLen*j]
                if word not in tempWordMap.keys():
                    flag=False
                    break
                else:
                    if tempWordMap[word]>0:
                        tempWordMap[word] = tempWordMap[word]-1
                    else:
                        flag=False
                        break
            if flag:
                result.append(i)
        return result

